import './App.css';
import { Test } from '../Test/Test';
import { Header } from '../../Base/Header';
import { Navbar } from "../../Base/Navbar"

function App() {
  return (
    <div className="App">
      <h1 className='text-3xl font-bold'>
        <Header />
        <Test />
        <Navbar className="sticky top-[100vh]" />
      </h1>
    </div>
  );
}

export default App;
